import React from 'react';
import { Link } from 'react-router-dom';

const NavBar = () => {
  const sidebarStyle = {
    width: '200px',
    height: '100vh',
    backgroundColor: '#ADD8E6',
    position: 'fixed',
    top: 0,
    left: 0,
    padding: '20px',
    boxSizing: 'border-box'
  };

  const buttonStyle = {
    display: 'block',
    width: '100%',
    padding: '10px',
    margin: '20px 0',
    backgroundColor: 'white',
    border: 'none',
    borderRadius: '20px',
    cursor: 'pointer',
    textAlign: 'center',
    boxShadow: '0 4px 8px rgba(0,0,0,0.1)',
    fontSize: '16px',
  };

  return (
    <div style={sidebarStyle}>
      <h3 style={{ marginBottom: '40px', color: '#000' }}>Meet</h3>
      <Link to="/google-meet">
        <button style={buttonStyle}>Google Meet</button>
      </Link>
      <Link to="/meeting-notes">
        <button style={buttonStyle}>Meeting Notes</button>
      </Link>
      <Link to="/attendance">
        <button style={buttonStyle}>Attendance</button>
      </Link>
    </div>
  );
};

export default NavBar;
